import { Link } from "react-router-dom";
import "./Navbar.css";

function Navbar() {
  return (
    //   <nav class="nav-bar">
    //   <img src="./images/spotify-logo.png" alt="">
    //   <ul class="nav-menu">
    //     <li><a href="#">Premium</a></li>
    //     <li><a href="#">Discover</a></li>
    //     <li><a href="#">Help</a></li>
    //     <li><a href="#">Download</a></li>
    //   </ul>
    // </nav>
    <nav className="nav-bar">
      <Link to="/">Gift It Yourself</Link>
      <ul className="nav-menu">
        <li>
          <Link to="/">Home</Link>
        </li>
        <li>
          <Link to="/giftslist">Gift</Link>
        </li>
        <li>
          <Link to="/newgifts">New Gifts</Link>
        </li>
        <li>
          <Link to="/random">Random message</Link>
        </li>
        </ul>
          <Link to="/contact">
            <button type="button" className="text btn btn-dark rounded-pill">
              Contact us
            </button>
          </Link>


    </nav>
  );
}

export default Navbar;
